import React from "react";
import "../index.css";
import Header from "./header/Header.js";
import Main from "./main/Main.js";
import Footer from "./footer/Footer.js";
import PopupWithForm from "./PopupWithForm.js";
import ImagePopup from "./ImagePopup.js";
function App() {
	const [isEditProfilePopupOpen, setEditProfilePopupOpen] =
		React.useState(false);

	const [isAddPlacePopupOpen, setAddPlacePopupOpen] = React.useState(false);

	const [isEditAvatarPopupOpen, setEditAvatarPopupOpen] = React.useState(false);

	const closeAllPopups = () => {
		console.log("click");
		setEditProfilePopupOpen(!isEditProfilePopupOpen);
		setAddPlacePopupOpen(!isAddPlacePopupOpen);
		setEditAvatarPopupOpen(!isEditAvatarPopupOpen);
	};

	function handleEditProfileClick() {
		setEditProfilePopupOpen(!isEditProfilePopupOpen);
	}

	function handleAddPlaceClick() {
		setAddPlacePopupOpen(!isAddPlacePopupOpen);
	}

	function handleEditAvatarClick() {
		setEditAvatarPopupOpen(!isEditAvatarPopupOpen);
	}
	return (
		<div className="page__content">
			<Header />
			<Main
				onEditProfile={handleEditProfileClick}
				onAddPlace={handleAddPlaceClick}
				onEditAvatar={handleEditAvatarClick}
			/>
			<Footer />

			<PopupWithForm
				name="edit-profile"
				title="Редактировать профиль"
				children={
					<React.Fragment>
						<fieldset className="popup__input-group">
							<input
								id="place-input"
								type="text"
								name="name"
								className="popup__input popup__input_type_img-title"
								placeholder="Название"
								defaultValue=""
								minLength={2}
								maxLength={30}
								required=""
							/>
							<span
								id="place-input-error"
								className="place-input-error popup__input-error"
							/>
						</fieldset>
						<fieldset className="popup__input-group">
							<input
								id="img-input"
								type="text"
								name="link"
								className="popup__input popup__input_type_img-link"
								placeholder="Ссылка на картинку"
								defaultValue=""
								pattern="https?://.+"
								required=""
							/>
							<span
								id="img-input-error"
								className="img-input-error popup__input-error"
							/>
						</fieldset>
					</React.Fragment>
				}
				button="Сохранить"
				isOpen={isEditProfilePopupOpen}
				onClose={closeAllPopups}
			/>

			<PopupWithForm
				name="add-card"
				title="Новое место"
				children={
					<React.Fragment>
						<fieldset className="popup__input-group">
							<input
								id="place-input"
								type="text"
								name="name"
								className="popup__input popup__input_type_img-title"
								placeholder="Название"
								defaultValue=""
								minLength={2}
								maxLength={30}
								required=""
							/>
							<span
								id="place-input-error"
								className="place-input-error popup__input-error"
							/>
						</fieldset>
						<fieldset className="popup__input-group">
							<input
								id="img-input"
								type="text"
								name="link"
								className="popup__input popup__input_type_img-link"
								placeholder="Ссылка на картинку"
								defaultValue=""
								pattern="https?://.+"
								required=""
							/>
							<span
								id="img-input-error"
								className="img-input-error popup__input-error"
							/>
						</fieldset>
					</React.Fragment>
				}
				button="Создать"
				isOpen={isAddPlacePopupOpen}
				onClose={closeAllPopups}

			/>
			<PopupWithForm
				name="confirmation"
				title="Вы уверены?"
				button="Да"
				popupContent="popup__container_content_confirmation"
			/>

			<PopupWithForm
				name="edit-avatar"
				title="Обновить аватар"
				children={
					<React.Fragment>
						<fieldset className="popup__input-group">
							<input
								id="owner-avatar"
								type="url"
								name="avatar"
								className="popup__input popup__input_type_img-link"
								placeholder="Ссылка на картинку"
								defaultValue=""
								pattern="https?://.+"
								required=""
							/>
							<span
								id="owner-avatar-error"
								className="img-input-error popup__input-error"
							/>
						</fieldset>
					</React.Fragment>
				}
				button="Сохранить"
				popupContent="popup__container_content_edit-avatar"
				isOpen={isEditAvatarPopupOpen}
			/>

			<ImagePopup />
		</div>
	);
}

export default App;
